INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 5, 0, 7, 0, 0, "しずる", 0, 0, 120301, 0, 0, 0.0, "", 0, "シズル（ノワール）", 0, 0, 0, 0, 3, 120301, 0);
