INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 180801, 0, 0, 0, "みそぎ", 1, 465, 120501, 1, 0, 0.0, "", 0, "ミソギ（リトルリリカル）", 0, 0, 0, 0, 3, 120501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 180801, 0, 0, 0, "きょうか", 1, 465, 120601, 1, 0, 0.0, "", 0, "キョウカ（リトルリリカル）", 0, 0, 0, 0, 3, 120601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (120701, "2026/01/15 12:00:00", "2026/01/31 11:59:59", 4, 0, 22, 1, 1, "しぇふぃ", 1, 283, 120701, 0, 450, 1.84, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 120701, "シェフィ（ニューイヤー）", 0, 0, 0, 0, 3, 120701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (120801, "2023/10/16 15:00:00", "2030/12/31 15:00:00", 4, 0, 22, 1, 2, "るか", 1, 193, 120801, 0, 450, 1.3, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 120801, "ルカ（ニューイヤー）", 0, 0, 0, 0, 1, 120801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (120901, "2026/01/15 12:00:00", "2026/01/31 11:59:59", 3, 0, 38, 2, 12, "いりや", 1, 424, 120901, 0, 450, 1.425, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 120901, "イリヤ（ニューイヤー）", 0, 0, 0, 0, 3, 120901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (121001, "2025/02/20 12:00:00", "2025/02/24 11:59:59", 5, 0, 41, 1, 1, "ぺこりーぬ", 1, 164, 121001, 0, 450, 2.25, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 121001, "ペコリーヌ（オーバーロード）", 0, 0, 0, 0, 3, 121001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (121101, "2025/02/20 12:00:00", "2025/02/24 11:59:59", 7, 0, 42, 2, 1, "きゃる", 1, 588, 121101, 0, 450, 2.07, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 121101, "キャル（オーバーロード）", 0, 0, 0, 0, 3, 121101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (121201, "2023/11/16 15:00:00", "2030/12/31 15:00:00", 4, 0, 40, 1, 6, "らびりすた", 1, 260, 121201, 0, 450, 1.55, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 121201, "ラビリスタ（オーバーロード）", 0, 0, 0, 0, 1, 121201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (121301, "2022/03/03 19:00:00", "2030/12/31 15:00:00", 3, 0, 3, 1, 3, "くるみ", 0, 731, 121301, 0, 450, 1.9, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 121301, "クルミ（ステージ）", 0, 0, 0, 0, 3, 121301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (121401, "2022/03/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 7, 2, 15, "みさき", 0, 742, 121401, 0, 450, 2.27, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 121401, "ミサキ（ステージ）", 0, 0, 0, 0, 3, 121401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (121501, "2025/04/26 12:00:00", "2025/04/30 11:59:59", 6, 0, 6, 1, 12, "あゆみ", 1, 590, 121501, 0, 450, 2.0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 121501, "アユミ（怪盗）", 0, 0, 0, 0, 3, 121501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (121601, "2022/04/15 15:00:00", "2030/12/31 15:00:00", 3, 0, 3, 1, 17, "いのり", 0, 292, 121601, 0, 450, 1.425, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 121601, "イノリ（怪盗）", 0, 0, 0, 0, 3, 121601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 180901, 0, 0, 0, "あきの", 1, 421, 121701, 1, 0, 0.0, "", 0, "アキノ（アキノ＆サレン）", 0, 0, 0, 0, 3, 121701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 180901, 0, 0, 0, "されん", 1, 421, 121801, 1, 0, 0.0, "", 0, "サレン（アキノ＆サレン）", 0, 0, 0, 0, 3, 121801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (121901, "2022/05/15 15:00:00", "2030/12/31 15:00:00", 5, 0, 5, 2, 12, "あんな", 0, 293, 121901, 0, 450, 2.125, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 121901, "アンナ（パイレーツ）", 0, 0, 0, 0, 3, 121901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122001, "2022/05/03 19:00:00", "2030/12/31 15:00:00", 3, 0, 3, 1, 14, "しのぶ", 0, 380, 122001, 0, 450, 1.425, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 122001, "シノブ（パイレーツ）", 0, 0, 0, 0, 3, 122001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122101, "2024/04/18 15:00:00", "2030/12/31 15:00:00", 35, 0, 35, 1, 9, "あおい", 1, 731, 122101, 0, 450, 1.97, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 122101, "アオイ（キャンプ）", 0, 0, 0, 0, 1, 122101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122201, "2022/05/31 12:00:00", "2030/12/31 15:00:00", 4, 0, 4, 1, 8, "ゆかり", 0, 419, 122201, 0, 450, 1.84, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 122201, "ユカリ（キャンプ）", 0, 0, 0, 0, 3, 122201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122301, "2022/06/15 15:00:00", "2030/12/31 15:00:00", 43, 0, 43, 2, 0, "うぁんぴぃ", 0, 564, 122301, 0, 450, 1.425, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 122301, "ヴァンピィ", 0, 0, 0, 0, 3, 122301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122401, "2024/06/17 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 1, 8, "ひより", 1, 264, 122401, 0, 450, 2.42, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 122401, "ヒヨリ（サマー）", 0, 0, 0, 0, 1, 122401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122501, "2025/08/22 12:00:00", "2025/08/31 11:59:59", 4, 0, 4, 1, 0, "れい", 1, 250, 122501, 0, 450, 1.965, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 122501, "レイ（サマー）", 0, 0, 0, 0, 3, 122501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122601, "2022/07/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 7, 2, 0, "ゆい", 0, 554, 122601, 0, 450, 2.27, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 122601, "ユイ（サマー）", 0, 0, 0, 0, 3, 122601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122701, "2022/08/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 7, 2, 0, "きょうか", 0, 812, 122701, 0, 450, 1.92, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 122701, "キョウカ（サマー）", 0, 0, 0, 0, 3, 122701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122801, "2024/07/16 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 1, 0, "みそぎ", 1, 237, 122801, 0, 450, 2.295, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 122801, "ミソギ（サマー）", 0, 0, 0, 0, 1, 122801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (122901, "2025/08/22 12:00:00", "2025/08/31 11:59:59", 5, 0, 5, 1, 0, "みみ", 1, 361, 122901, 0, 450, 2.25, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 122901, "ミミ（サマー）", 0, 0, 0, 0, 3, 122901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123001, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 44, 0, 44, 2, 0, "あめす", 1, 746, 123001, 0, 450, 2.27, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 123001, "アメス", 0, 0, 0, 0, 3, 123001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123101, "2022/09/03 19:00:00", "2030/12/31 15:00:00", 7, 0, 7, 2, 0, "まほ", 0, 793, 123101, 0, 450, 1.795, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 123101, "マホ（エクスプローラー）", 0, 0, 0, 0, 3, 123101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123201, "2022/09/15 15:00:00", "2030/12/31 15:00:00", 3, 0, 3, 1, 0, "あやね", 0, 256, 123201, 0, 450, 1.425, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 123201, "アヤネ（エクスプローラー）", 0, 0, 0, 0, 3, 123201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123301, "2025/09/16 15:00:00", "2025/09/30 11:59:59", 1, 0, 0, 1, 0, "ねあ", 1, 350, 123301, 0, 450, 1.62, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 123301, "ネア", 0, 0, 0, 0, 3, 123301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 5, 0, 5, 0, 0, "じゅん", 0, 0, 123401, 0, 0, 0.0, "", 0, "ジュン（キャンプ）", 0, 0, 0, 0, 3, 123401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123501, "2024/09/17 15:00:00", "2030/12/31 15:00:00", 6, 0, 6, 1, 0, "りん", 1, 583, 123501, 0, 450, 2.34, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 123501, "リン（ハロウィン）", 0, 0, 0, 0, 1, 123501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123601, "2025/11/14 15:00:00", "2025/11/30 11:59:59", 4, 0, 4, 1, 0, "とも", 1, 262, 123601, 0, 450, 1.965, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 123601, "トモ（ハロウィン）", 0, 0, 0, 0, 3, 123601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123701, "2022/10/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 21, 2, 0, "ななか", 0, 741, 123701, 0, 450, 2.07, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 123701, "ナナカ（ハロウィン）", 0, 0, 0, 0, 3, 123701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123801, "2025/11/03 12:00:00", "2025/11/14 14:59:59", 1, 0, 1, 1, 0, "くりすてぃーな", 1, 238, 123801, 0, 450, 2.295, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 123801, "クリスティーナ（ワイルド）", 0, 0, 0, 0, 3, 123801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (123901, "2022/11/15 15:00:00", "2030/12/31 15:00:00", 2, 0, 2, 1, 0, "まつり", 0, 183, 123901, 0, 450, 2.125, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 123901, "マツリ（ワイルド）", 0, 0, 0, 0, 3, 123901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (124001, "2025/12/21 12:00:00", "2025/12/31 11:59:59", 7, 0, 7, 2, 0, "あかり", 1, 438, 124001, 0, 450, 2.07, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 124001, "アカリ（クリスマス）", 0, 0, 0, 0, 3, 124001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (124101, "2024/11/16 15:00:00", "2030/12/31 15:00:00", 6, 0, 6, 2, 0, "より", 1, 433, 124101, 0, 450, 1.965, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 124101, "ヨリ（クリスマス）", 0, 0, 0, 0, 1, 124101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (124201, "2022/12/23 12:00:00", "2030/12/31 15:00:00", 5, 0, 5, 1, 0, "じゅん", 0, 144, 124201, 0, 450, 2.07, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 124201, "ジュン（クリスマス）", 0, 0, 0, 0, 3, 124201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 181001, 0, 0, 0, "あん", 1, 577, 124301, 1, 0, 0.0, "", 0, "アン（アン＆グレア）", 0, 0, 0, 0, 3, 124301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 181001, 0, 0, 0, "ぐれあ", 1, 577, 124401, 1, 0, 0.0, "", 0, "グレア（アン＆グレア）", 0, 0, 0, 0, 3, 124401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (124501, "2026/01/15 12:00:00", "2026/01/31 11:59:59", 7, 0, 21, 2, 0, "ほまれ", 1, 707, 124501, 0, 450, 2.07, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 124501, "ホマレ（ニューイヤー）", 0, 0, 0, 0, 3, 124501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (124601, "2026/01/15 12:00:00", "2026/01/31 11:59:59", 7, 0, 21, 2, 0, "みさと", 1, 698, 124601, 0, 450, 2.44, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 124601, "ミサト（ニューイヤー）", 0, 0, 0, 0, 3, 124601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (124701, "2024/12/16 15:00:00", "2030/12/31 15:00:00", 7, 0, 46, 1, 0, "みつき", 1, 590, 124701, 0, 450, 2.24, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 124701, "ミツキ（ニューイヤー）", 0, 0, 0, 0, 1, 124701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (124801, "2025/02/20 12:00:00", "2025/02/24 11:59:59", 4, 0, 0, 1, 0, "のぞみ", 1, 423, 124801, 0, 450, 2.14, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 124801, "ノゾミ（リベレイター）", 0, 0, 0, 0, 3, 124801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (124901, "2025/01/16 15:00:00", "2030/12/31 15:00:00", 1, 0, 0, 1, 0, "かや", 1, 170, 124901, 0, 450, 1.965, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 124901, "カヤ（リベレイター）", 0, 0, 0, 0, 1, 124901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125001, "2025/02/20 12:00:00", "2025/02/24 11:59:59", 5, 0, 0, 1, 0, "むいみ", 1, 221, 125001, 0, 450, 1.965, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 125001, "ムイミ（リベレイター）", 0, 0, 0, 0, 3, 125001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125101, "2023/03/03 19:00:00", "2030/12/31 15:00:00", 8, 0, 47, 1, 0, "たまき", 0, 825, 125101, 0, 450, 2.24, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 125101, "タマキ（カフェ）", 0, 0, 0, 0, 3, 125101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125201, "2023/03/10 12:00:00", "2030/12/31 15:00:00", 4, 0, 4, 1, 0, "もにか", 0, 463, 125201, 0, 450, 1.965, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 125201, "モニカ（カフェ）", 0, 0, 0, 0, 3, 125201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125301, "2025/04/26 12:00:00", "2025/04/30 11:59:59", 6, 0, 6, 1, 0, "こっころ", 1, 752, 125301, 0, 450, 2.07, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 125301, "コッコロ（レンジャー）", 0, 0, 0, 0, 3, 125301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125401, "2023/04/10 12:00:00", "2030/12/31 15:00:00", 8, 0, 8, 1, 0, "しおり", 0, 710, 125401, 0, 450, 2.09, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 125401, "シオリ（レンジャー）", 0, 0, 0, 0, 3, 125401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125501, "2025/05/15 15:00:00", "2025/05/31 11:59:59", 7, 0, 50, 2, 0, "じーた", 1, 443, 125501, 0, 450, 1.92, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 125501, "ジータ（ウォーロック）", 0, 0, 0, 0, 3, 125501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125601, "2025/05/15 15:00:00", "2025/05/31 11:59:59", 51, 0, 0, 1, 0, "びから", 1, 267, 125601, 0, 450, 2.09, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 125601, "ビカラ", 0, 0, 0, 0, 3, 125601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125701, "2025/04/16 15:00:00", "2030/12/31 15:00:00", 7, 0, 9, 2, 0, "かりん", 1, 579, 125701, 0, 450, 2.24, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 125701, "カリン（アルケミスト）", 0, 0, 0, 0, 1, 125701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (125801, "2023/04/17 12:00:00", "2030/12/31 15:00:00", 3, 0, 0, 1, 0, "りり", 0, 464, 125801, 0, 450, 2.09, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 125801, "リリ（フォールン）", 0, 0, 0, 0, 3, 125801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "かや", 1, 0, 125901, 0, 0, 0.0, "", 0, "カヤ（リベレイター）", 0, 0, 0, 0, 3, 125901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126001, "2023/10/31 12:00:00", "2030/12/31 15:00:00", 0, 0, 0, 1, 0, "くりあ", 0, 406, 126001, 0, 450, 2.09, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 126001, "クリア（フォールン）", 0, 0, 0, 0, 3, 126001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126101, "2023/11/15 15:00:00", "2030/12/31 15:00:00", 44, 0, 53, 2, 0, "ぷれしあ", 0, 480, 126101, 0, 450, 2.09, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 126101, "プレシア（フォールン）", 0, 0, 0, 0, 3, 126101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126201, "2025/06/10 12:00:00", "2025/06/20 11:59:59", 3, 0, 3, 2, 0, "いりや", 1, 568, 126201, 0, 450, 2.09, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 126201, "イリヤ（儀装束）", 0, 0, 0, 0, 3, 126201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126301, "2023/06/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 9, 2, 0, "ゆき", 0, 456, 126301, 0, 450, 2.07, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 126301, "ユキ（儀装束）", 0, 0, 0, 0, 3, 126301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126401, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 1, 0, 1, 1, 0, "くろーちぇ", 1, 373, 126401, 0, 450, 2.09, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 126401, "クローチェ", 0, 0, 0, 0, 3, 126401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126501, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 7, 0, 0, 2, 0, "らいらえる", 1, 740, 126501, 0, 450, 1.965, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 126501, "ライラエル", 0, 0, 0, 0, 3, 126501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126601, "2025/08/10 12:00:00", "2025/08/15 14:59:59", 7, 0, 7, 2, 0, "ねねか", 1, 650, 126601, 0, 450, 2.04, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 126601, "ネネカ（サマー）", 0, 0, 0, 0, 3, 126601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126701, "2025/06/17 15:00:00", "2030/12/31 15:00:00", 5, 0, 5, 1, 0, "あきの", 1, 224, 126701, 0, 450, 1.965, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 126701, "アキノ（サマー）", 0, 0, 0, 0, 1, 126701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126801, "2023/07/15 15:00:00", "2030/12/31 15:00:00", 5, 0, 5, 1, 0, "ゆかり", 0, 159, 126801, 0, 450, 1.97, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 126801, "ユカリ（サマー）", 0, 0, 0, 0, 3, 126801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (126901, "2025/08/22 12:00:00", "2025/08/31 11:59:59", 7, 0, 21, 2, 0, "らんふぁ", 1, 682, 126901, 0, 450, 1.965, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 126901, "ランファ（サマー）", 0, 0, 0, 0, 3, 126901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127001, "2025/07/16 15:00:00", "2030/12/31 15:00:00", 2, 0, 52, 1, 0, "くうか", 1, 133, 127001, 0, 450, 1.97, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 127001, "クウカ（サマー）", 0, 0, 0, 0, 1, 127001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127101, "2025/08/22 12:00:00", "2025/08/31 11:59:59", 5, 0, 46, 1, 0, "しのぶ", 1, 255, 127101, 0, 450, 2.09, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 127101, "シノブ（サマー）", 0, 0, 0, 0, 3, 127101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127201, "2025/09/16 15:00:00", "2025/09/30 11:59:59", 7, 0, 7, 2, 0, "きゃる", 1, 804, 127201, 0, 450, 2.09, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 127201, "キャル（編入生）", 0, 0, 0, 0, 3, 127201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127301, "2023/09/15 15:00:00", "2030/12/31 15:00:00", 8, 0, 8, 1, 0, "すずな", 0, 750, 127301, 0, 450, 2.09, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 127301, "スズナ（編入生）", 0, 0, 0, 0, 3, 127301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "びから", 1, 0, 127401, 0, 0, 0.0, "", 0, "ビカラ（コラボ）", 0, 0, 0, 0, 3, 127401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127501, "2024/11/11 12:00:00", "2024/11/18 11:59:59", 4, 0, 4, 1, 0, "されん", 1, 304, 127501, 0, 450, 2.09, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 127501, "サレン（サラサリア）", 0, 0, 0, 0, 3, 127501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127601, "2023/10/15 15:00:00", "2030/12/31 15:00:00", 4, 0, 4, 1, 0, "るか", 0, 157, 127601, 0, 450, 1.965, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 127601, "ルカ（サラサリア）", 0, 0, 0, 0, 3, 127601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127701, "2024/10/10 12:00:00", "2030/12/31 15:00:00", 6, 0, 48, 2, 0, "りんど", 0, 693, 127701, 0, 450, 1.965, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 127701, "リンド", 0, 0, 0, 0, 3, 127701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127801, "2024/10/18 12:00:00", "2030/12/31 15:00:00", 7, 0, 47, 2, 0, "うるむ", 0, 706, 127801, 0, 450, 1.965, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 127801, "ヴルム", 0, 0, 0, 0, 3, 127801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (127901, "2025/12/21 12:00:00", "2025/12/31 11:59:59", 5, 0, 5, 2, 0, "ぺこりーぬ", 1, 372, 127901, 0, 450, 1.965, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 127901, "ペコリーヌ（クリスマス）", 0, 0, 0, 0, 3, 127901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (128001, "2023/12/15 15:00:00", "2030/12/31 15:00:00", 35, 0, 35, 1, 0, "くれじった", 0, 723, 128001, 0, 450, 2.09, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 128001, "クレジッタ（クリスマス）", 0, 0, 0, 0, 3, 128001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 181101, 0, 0, 0, "しずる", 1, 580, 128101, 1, 0, 0.0, "", 0, "シズル（シズル&リノ）", 0, 0, 0, 0, 3, 128101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0, 181101, 0, 0, 0, "りの", 1, 580, 128201, 1, 0, 0.0, "", 0, "リノ（シズル&リノ）", 0, 0, 0, 0, 3, 128201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (128301, "2026/01/16 15:00:00", "2030/12/31 15:00:00", 3, 0, 38, 1, 0, "いのり", 1, 191, 128301, 0, 450, 2.09, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 128301, "イノリ（ニューイヤー）", 0, 0, 0, 0, 1, 128301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (128401, "2026/01/15 12:00:00", "2026/01/31 11:59:59", 7, 0, 21, 2, 0, "はつね", 1, 801, 128401, 0, 450, 2.09, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 128401, "ハツネ（ニューイヤー）", 0, 0, 0, 0, 3, 128401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (128501, "2026/01/15 12:00:00", "2026/01/31 11:59:59", 7, 0, 21, 2, 0, "かすみ", 1, 739, 128501, 0, 450, 2.09, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 128501, "カスミ（ニューイヤー）", 0, 0, 0, 0, 3, 128501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "りり", 1, 0, 128601, 0, 0, 0.0, "", 0, "リリ（フォールン）", 0, 0, 0, 0, 3, 128601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (128701, "2025/02/10 12:00:00", "2025/02/15 14:59:59", 1, 0, 0, 1, 0, "ひより", 1, 226, 128701, 0, 450, 2.09, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 128701, "ヒヨリ（アストラル）", 0, 0, 0, 0, 3, 128701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (128801, "2025/08/16 15:00:00", "2030/12/31 15:00:00", 4, 0, 0, 1, 0, "れい", 1, 194, 128801, 0, 450, 1.965, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 128801, "レイ（アストラル）", 0, 0, 0, 0, 1, 128801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (128901, "2025/02/10 12:00:00", "2025/02/15 14:59:59", 7, 0, 0, 2, 0, "ゆい", 1, 772, 128901, 0, 450, 2.09, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 128901, "ユイ（アストラル）", 0, 0, 0, 0, 3, 128901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (129001, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 7, 0, 0, 2, 0, "えりす", 1, 800, 129001, 0, 450, 2.09, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 129001, "エリス", 0, 0, 0, 0, 3, 129001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (129301, "2025/03/10 12:00:00", "2025/03/15 14:59:59", 7, 0, 7, 1, 0, "ゆに", 1, 708, 129301, 0, 450, 2.09, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 129301, "ユニ（ウィンター）", 0, 0, 0, 0, 3, 129301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (129401, "2024/03/18 12:00:00", "2030/12/31 15:00:00", 2, 0, 2, 1, 0, "くろえ", 0, 188, 129401, 0, 450, 2.09, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 129401, "クロエ（ウィンター）", 0, 0, 0, 0, 3, 129401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (129501, "2025/11/30 12:00:00", "2025/12/15 14:59:59", 1, 0, 1, 1, 0, "ちえる", 1, 247, 129501, 0, 450, 2.09, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 129501, "チエル（ウィンター）", 0, 0, 0, 0, 3, 129501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (129601, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 0, "あねもね", 1, 550, 129601, 0, 450, 2.09, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 129601, "アネモネ", 0, 0, 0, 0, 3, 129601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (129701, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 0, "ねふぃーねら", 1, 540, 129701, 0, 450, 2.09, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 129701, "ネフィ＝ネラ", 0, 0, 0, 0, 3, 129701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (129801, "2025/04/26 12:00:00", "2025/04/30 11:59:59", 5, 0, 5, 1, 0, "まこと", 1, 269, 129801, 0, 450, 2.09, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 129801, "マコト（コマンダー）", 0, 0, 0, 0, 3, 129801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (129901, "2024/04/15 15:00:00", "2030/12/31 15:00:00", 6, 0, 48, 1, 0, "えりこ", 0, 294, 129901, 0, 450, 1.84, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 129901, "エリコ（コマンダー）", 0, 0, 0, 0, 3, 129901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (130001, "2025/11/03 12:00:00", "2025/11/14 14:59:59", 4, 0, 0, 1, 0, "やまと", 1, 150, 130001, 0, 450, 2.09, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 130001, "ヤマト", 0, 0, 0, 0, 3, 130001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (130101, "2025/11/03 12:00:00", "2025/11/14 14:59:59", 7, 0, 9, 1, 0, "わかな", 1, 535, 130101, 0, 450, 2.09, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 130101, "ワカナ", 0, 0, 0, 0, 3, 130101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (130201, "2025/11/03 12:00:00", "2025/11/14 14:59:59", 5, 0, 0, 1, 0, "ふぶき", 1, 371, 130201, 0, 450, 1.84, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 130201, "フブキ", 0, 0, 0, 0, 3, 130201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 4, 0, 1, 0, 0, "れい", 1, 0, 130601, 0, 0, 0.0, "", 0, "レイ（アストラル）", 0, 0, 0, 0, 3, 130601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (130701, "2025/05/03 19:00:00", "2025/05/15 14:59:59", 7, 0, 7, 2, 0, "きょうか", 1, 563, 130701, 0, 450, 1.92, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 130701, "キョウカ（スプリング）", 0, 0, 0, 0, 3, 130701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (130801, "2024/05/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 7, 2, 0, "すずめ", 0, 558, 130801, 0, 450, 1.84, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 130801, "スズメ（スプリング）", 0, 0, 0, 0, 3, 130801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (130901, "2024/06/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 7, 2, 0, "くるる", 0, 440, 130901, 0, 450, 2.09, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 130901, "クルル", 0, 0, 0, 0, 3, 130901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (131001, "2025/06/10 12:00:00", "2025/06/20 11:59:59", 7, 0, 7, 2, 0, "まほ", 1, 702, 131001, 0, 450, 1.84, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 131001, "マホ（ドリームパーク）", 0, 0, 0, 0, 3, 131001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (131101, "2024/06/30 12:00:00", "2030/12/31 15:00:00", 2, 0, 52, 1, 0, "ねあ", 0, 165, 131101, 0, 450, 2.09, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 131101, "ネア（サマー）", 0, 0, 0, 0, 3, 131101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (131201, "2025/07/10 12:00:00", "2025/07/23 11:59:59", 54, 0, 54, 2, 0, "みそら", 1, 753, 131201, 0, 450, 2.09, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 131201, "ミソラ（サマー）", 0, 0, 0, 0, 3, 131201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "りり", 1, 0, 131301, 1, 0, 0.0, "", 0, "リリ", 0, 0, 0, 0, 3, 131301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "くりあ", 1, 0, 131401, 1, 0, 0.0, "", 0, "クリア", 0, 0, 0, 0, 3, 131401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "ぷれしあ", 1, 0, 131501, 1, 0, 0.0, "", 0, "プレシア", 0, 0, 0, 0, 3, 131501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (131601, "2025/07/10 12:00:00", "2025/07/23 11:59:59", 4, 0, 4, 1, 0, "りり", 1, 399, 131601, 0, 450, 1.92, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 131601, "リリ（サマー）", 0, 0, 0, 0, 3, 131601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (131701, "2025/08/10 12:00:00", "2025/08/15 14:59:59", 44, 0, 53, 2, 0, "あめす", 1, 743, 131701, 0, 450, 1.92, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 131701, "アメス（サマー）", 0, 0, 0, 0, 3, 131701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (131801, "2024/08/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 21, 2, 0, "ほまれ", 0, 709, 131801, 0, 450, 2.09, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 131801, "ホマレ（サマー）", 0, 0, 0, 0, 3, 131801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (131901, "2024/08/31 12:00:00", "2030/12/31 15:00:00", 7, 0, 23, 2, 0, "えみりあ", 1, 725, 131901, 1, 450, 2.09, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 131901, "エミリア（サマー）", 0, 0, 0, 0, 1, 131901, 1);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (132001, "2025/10/10 12:00:00", "2025/10/24 11:59:59", 7, 0, 21, 2, 0, "えきどな", 1, 775, 132001, 0, 450, 2.09, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 132001, "エキドナ（サマー）", 0, 0, 0, 0, 3, 132001, 1);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (132101, "2025/10/10 12:00:00", "2025/10/24 11:59:59", 13, 0, 24, 1, 0, "れむ", 1, 146, 132101, 0, 450, 2.09, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 132101, "レム（サマー）", 0, 0, 0, 0, 3, 132101, 1);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (132201, "2025/10/24 12:00:00", "2025/10/31 11:59:59", 7, 0, 7, 2, 0, "のぞみ", 1, 721, 132201, 0, 450, 1.84, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 132201, "ノゾミ（アルケミスト）", 0, 0, 0, 0, 3, 132201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (132301, "2025/11/30 12:00:00", "2025/12/15 14:59:59", 7, 0, 7, 2, 0, "るいずまりー", 1, 754, 132301, 0, 450, 2.09, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 132301, "ルイズマリー", 0, 0, 0, 0, 3, 132301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (132401, "2025/06/20 12:00:00", "2030/12/31 15:00:00", 5, 0, 0, 1, 0, "いろは", 0, 501, 132401, 0, 450, 2.09, "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", 132401, "イロハ", 0, 0, 0, 0, 3, 132401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (132501, "2025/05/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 23, 2, 0, "その", 0, 636, 132501, 0, 450, 2.09, "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", 132501, "ソノ", 0, 0, 0, 0, 3, 132501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (132801, "2025/11/30 12:00:00", "2025/12/15 14:59:59", 7, 0, 0, 2, 0, "らいらえる", 1, 750, 132801, 0, 450, 2.09, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 132801, "ライラエル（クリスマス）", 0, 0, 0, 0, 3, 132801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (132901, "2024/12/09 12:00:00", "2030/12/31 15:00:00", 5, 0, 46, 2, 0, "いお", 0, 748, 132901, 0, 450, 2.09, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 132901, "イオ（クリスマス）", 0, 0, 0, 0, 3, 132901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (133001, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 0, "ぐれいす", 1, 234, 133001, 0, 450, 2.09, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 133001, "グレイス", 0, 0, 0, 0, 3, 133001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (133101, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 0, "うぁいおれっと", 1, 154, 133101, 0, 450, 1.75, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 133101, "ヴァイオレット", 0, 0, 0, 0, 3, 133101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (133201, "2024/12/31 12:00:00", "2030/12/31 15:00:00", 4, 0, 22, 1, 0, "もにか", 1, 296, 133201, 1, 450, 2.09, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 133201, "モニカ（ニューイヤー）", 0, 0, 0, 0, 1, 133201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (133501, "2026/01/03 12:00:00", "2026/01/15 11:59:59", 4, 0, 22, 2, 0, "されん", 1, 718, 133501, 0, 450, 2.09, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 133501, "サレン（ニューイヤー）", 0, 0, 0, 0, 3, 133501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (133601, "2026/01/03 12:00:00", "2026/01/15 11:59:59", 0, 0, 0, 1, 0, "めどぅーさ", 1, 445, 133601, 0, 450, 2.09, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 133601, "メドゥーサ", 0, 0, 0, 0, 3, 133601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (133701, "2025/08/15 15:00:00", "2025/08/22 11:59:59", 8, 0, 0, 2, 0, "らびりすた", 1, 717, 133701, 0, 450, 2.09, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 133701, "ラビリスタ（アルファ）", 0, 0, 0, 0, 3, 133701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (133801, "2025/08/15 15:00:00", "2025/08/22 11:59:59", 7, 0, 0, 2, 0, "ねねか", 1, 759, 133801, 0, 450, 2.09, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 133801, "ネネカ（アルファ）", 0, 0, 0, 0, 3, 133801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (133901, "2025/08/15 15:00:00", "2025/08/22 11:59:59", 6, 0, 0, 1, 0, "くりすてぃーな", 1, 228, 133901, 0, 450, 2.09, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 133901, "クリスティーナ（アルファ）", 0, 0, 0, 0, 3, 133901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (134001, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 2, 0, "ふぃお", 1, 746, 134001, 0, 450, 2.09, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 134001, "フィオ", 0, 0, 0, 0, 3, 134001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 5, 0, 1, 0, 0, "ふぶき", 1, 0, 134101, 0, 0, 0.0, "", 0, "フブキ", 0, 0, 0, 0, 3, 134101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 7, 0, 1, 0, 0, "らいらえる", 1, 0, 134201, 0, 0, 0.0, "", 0, "ライラエル（クリスマス）", 0, 0, 0, 0, 3, 134201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (134301, "2025/09/16 15:00:00", "2025/09/30 11:59:59", 7, 0, 0, 2, 0, "らんふぁ", 1, 778, 134301, 0, 450, 2.09, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 134301, "ランファ（儀装束）", 0, 0, 0, 0, 3, 134301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (134401, "2025/03/15 15:00:00", "2030/12/31 15:00:00", 7, 0, 21, 2, 0, "ちか", 0, 773, 134401, 0, 450, 2.09, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 134401, "チカ（儀装束）", 0, 0, 0, 0, 3, 134401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (134501, "2025/11/03 12:00:00", "2025/11/14 14:59:59", 0, 0, 0, 2, 0, "くろーちぇ", 1, 719, 134501, 0, 450, 2.09, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 134501, "クローチェ（エアリアル）", 0, 0, 0, 0, 3, 134501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (134601, "2025/11/03 12:00:00", "2025/11/14 14:59:59", 35, 0, 35, 1, 0, "あおい", 1, 526, 134601, 0, 450, 2.09, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 134601, "アオイ（パイロット）", 0, 0, 0, 0, 3, 134601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (134701, "2025/11/03 12:00:00", "2025/11/14 14:59:59", 7, 0, 7, 1, 0, "ほうおう", 1, 490, 134701, 0, 450, 2.09, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 134701, "ホウオウ", 0, 0, 0, 0, 3, 134701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (134801, "2026/01/03 12:00:00", "2026/01/15 11:59:59", 1, 0, 1, 1, 0, "つむぎ", 1, 485, 134801, 0, 450, 1.84, "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", 134801, "ツムギ（ジオ・ゲヘナ）", 0, 0, 0, 0, 3, 134801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (134901, "2026/01/03 12:00:00", "2026/01/15 11:59:59", 2, 0, 0, 1, 0, "かのん", 1, 196, 134901, 0, 450, 2.09, "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", 134901, "カノン", 0, 0, 0, 0, 3, 134901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135001, "2025/06/30 12:00:00", "2025/07/10 11:59:59", 7, 0, 21, 2, 0, "えりす", 1, 785, 135001, 0, 450, 2.09, "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", 135001, "エリス（サマー）", 0, 0, 0, 0, 3, 135001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135101, "2025/07/10 12:00:00", "2025/07/23 11:59:59", 4, 0, 4, 1, 0, "しぇふぃ", 1, 143, 135101, 0, 450, 2.09, "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", 135101, "シェフィ（サマー）", 0, 0, 0, 0, 3, 135101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135201, "2025/07/23 12:00:00", "2025/07/31 11:59:59", 7, 0, 7, 2, 0, "ぷれしあ", 1, 548, 135201, 0, 450, 2.09, "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", 135201, "プレシア（サマー）", 0, 0, 0, 0, 3, 135201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135301, "2025/07/31 12:00:00", "2025/08/10 11:59:59", 54, 0, 54, 1, 0, "くりあ", 1, 413, 135301, 0, 450, 2.09, "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", 135301, "クリア（サマー）", 0, 0, 0, 0, 3, 135301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135401, "2025/08/10 12:00:00", "2025/08/15 14:59:59", 2, 0, 52, 2, 0, "あねもね", 1, 553, 135401, 0, 450, 2.09, "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", 135401, "アネモネ（サマー）", 0, 0, 0, 0, 3, 135401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135501, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 1, 0, 0, 1, 0, "あいら", 1, 213, 135501, 0, 450, 2.09, "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", 135501, "アイラ", 0, 0, 0, 0, 3, 135501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135601, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 4, 0, 0, 1, 0, "しなつ", 1, 198, 135601, 0, 450, 0.4, "【物理】前衛から、風裂く刃で世界を護る孤高の剣豪。\n卓越した剣技で敵の攻撃を捌いて反撃し、初回ＵＢで生成\nする分身と共に疾風迅雷の攻めで、未来へと駆け抜ける。", 135601, "シナツ", 0, 0, 0, 0, 3, 135601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135701, "2025/09/16 15:00:00", "2030/12/31 15:00:00", 1, 0, 0, 1, 0, "ひより", 0, 291, 135701, 0, 450, 1.84, "【物理】前衛で、二人きりの月下の空旅にときめく黒猫。\n物防弱体の他、ダメージ100ヒット後には華麗なステップ\nの追撃とＴＰ回復量増加で、砂漠の夜空に花を咲かせる。", 135701, "ヒヨリ（サラサリア）", 0, 0, 0, 0, 3, 135701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135801, "2025/09/30 12:00:00", "2025/10/10 11:59:59", 7, 0, 0, 2, 0, "ゆきの", 1, 830, 135801, 0, 450, 2.09, "【魔法】後衛から、雪魄氷姿の三味を弾じる初心な雪女。\n多様なデバフ効果で敵を弱体化させ、最も魔防の低い敵の\n状態に応じて発生する追加効果で、冥府を真白に染める。", 135801, "ユキノ", 0, 0, 0, 0, 3, 135801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (135901, "2025/10/10 12:00:00", "2025/10/24 11:59:59", 3, 0, 0, 1, 0, "さつき", 1, 219, 135901, 0, 450, 1.84, "【物理】前衛で、華奢な体躯に厚い仁義を宿す鬼のお嬢。\n攻防自己強化や行動不能無効化で豪胆に立ち続け、自分が\n呪詛状態の時に振るう追加攻撃で、怪力無双の力を示す。", 135901, "サツキ", 0, 0, 0, 0, 3, 135901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (136001, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 11, 0, 0, 1, 0, "あらくね", 1, 732, 136001, 0, 450, 2.09, "【物理】後衛で、喪われた光を求めてもがく元『六凶』。\n敵のＵＢを遅延する【遮絶の操糸】や、味方単体のＵＢを\n連続発動可能にする【賦活の糸】を戦場に張り巡らせる。", 136001, "アラクネ", 0, 0, 0, 0, 3, 136001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (136101, "2025/10/24 12:00:00", "2025/11/03 11:59:59", 0, 0, 0, 1, 0, "さくら", 1, 432, 136101, 0, 450, 1.74, "【物理】中衛で不運に抗い歌い続けるゾンビィアイドル。\n一度倒れても立ち上がり、ＴＰを糧に強化されるスキルの\nダメージと味方の支援で、サガの心をアストルムに刻む。", 136101, "サクラ", 0, 0, 0, 0, 3, 136101, 1);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (136201, "2025/11/14 15:00:00", "2030/12/31 15:00:00", 3, 0, 3, 1, 0, "なーな", 0, 198, 136201, 0, 450, 2.09, "【物理】前衛でダメダメでも逃げず戦うアルミラージ娘。\n最も近くの味方に強化や行動不能無効の付与、回復を行い\n敵の注意をそらすことで、過酷な世界を生き延びる。", 136201, "ナーナ", 0, 0, 0, 0, 3, 136201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (136301, "2025/12/15 15:00:00", "2025/12/21 11:59:59", 35, 0, 54, 2, 0, "みそら", 1, 655, 136301, 0, 450, 2.09, "【魔法】後衛で、シゲキ的な聖夜に鼓動高鳴る溌溂少女★\n【イルミネーションバレット】を消費して味方を支援し、\n40消費後は追加の範囲攻撃やバフでキュン★を届ける。", 136301, "ミソラ（クリスマス）", 0, 0, 0, 0, 3, 136301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (136401, "2025/11/30 12:00:00", "2025/12/15 14:59:59", 7, 0, 21, 2, 0, "ゆい", 1, 382, 136401, 0, 450, 1.84, "【魔法】中衛で、騎士の隣に一歩踏み出す聖夜の魔法士。\n敵の注目を集めながら攻防支援を行い【聖夜の愛慕】が\n高まると、ＴＰ支援やダメージカットで優しく包み込む。", 136401, "ユイ（クリスマス）", 0, 0, 0, 0, 3, 136401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (136501, "2026/01/03 12:00:00", "2026/01/15 11:59:59", 5, 0, 0, 1, 0, "しずる", 1, 151, 136501, 0, 450, 2.09, "【物理】前衛で、凛然と立ちはだかる新年のお姉ちゃん。\n挑発と行動不能無効で攻撃を鮮やかに捌き、状況に応じて\n物理・魔法を自在に操り、弟くんへの愛を見せつける。", 136501, "シズル（ニューイヤー）", 0, 0, 0, 0, 3, 136501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "めどぅーさ", 0, 0, 136601, 0, 0, 0.0, "", 0, "メドゥーサ", 0, 0, 0, 0, 1, 136601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 8, 0, 1, 0, 0, "らびりすた", 1, 0, 136701, 0, 0, 0.0, "", 0, "ラビリスタ（アルファ）", 0, 0, 0, 0, 3, 136701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 7, 0, 1, 0, 0, "らんふぁ", 1, 0, 136801, 0, 0, 0.0, "", 0, "ランファ（儀装束）", 0, 0, 0, 0, 3, 136801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (137101, "2025/08/15 15:00:00", "2030/12/31 15:00:00", 8, 0, 47, 2, 0, "にのん", 0, 566, 137101, 0, 450, 2.09, "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 137101, "ニノン（サマー）", 0, 0, 0, 0, 3, 137101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 2, 0, 2, 0, 0, "らびりすた", 0, 0, 137201, 0, 0, 0.0, "", 0, "ラビリスタ", 0, 0, 0, 0, 3, 137201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 2, 0, 1, 0, 0, "かのん", 1, 0, 137301, 0, 0, 0.0, "", 0, "カノン", 0, 0, 0, 0, 3, 137301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (137401, "2025/11/03 12:00:00", "2025/11/14 14:59:59", 7, 0, 21, 2, 0, "かすみ", 1, 688, 137401, 0, 450, 2.09, "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", 137401, "カスミ（シスター）", 0, 0, 0, 0, 3, 137401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "あいら", 1, 0, 137501, 0, 0, 0.0, "", 0, "アイラ", 0, 0, 0, 0, 3, 137501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (137601, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 7, 0, 0, 2, 0, "こっころ", 1, 733, 137601, 0, 450, 2.09, "【魔法】後衛で、主さまを想い“進化”した嚮導の巫女。\n極大ダメージのＵＢで敵を穿ち、【進化超越】の権能によ\nって、味方のバフやダメージを、限界を超え成長させる。", 137601, "コッコロ（嚮導幼君）", 0, 0, 0, 0, 3, 137601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 7, 0, 1, 0, 0, "ゆきの", 1, 0, 137801, 0, 0, 0.0, "", 0, "ユキノ", 0, 0, 0, 0, 3, 137801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (137901, "2026/01/15 12:00:00", "2026/01/31 11:59:59", 8, 0, 8, 2, 0, "りの", 1, 684, 137901, 0, 450, 2.09, "【魔法】後衛で絵馬に込めた想いを胸に抱く晴れ着の妹。\nクリティカル時に威力が上がる矢で敵を撃ち抜き、味方\n全体への攻撃支援や継続ＴＰ回復で厄を払い福を届ける。", 137901, "リノ（ニューイヤー）", 0, 0, 0, 0, 3, 137901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "さくら", 1, 0, 138601, 0, 0, 0.0, "", 0, "サクラ", 0, 0, 0, 0, 3, 138601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 0, 0, "しずる", 0, 0, 141401, 0, 0, 0.0, "", 0, "シズル（ニューイヤー）", 0, 0, 0, 0, 1, 141401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (170101, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 34, 0, 34, 1, 4, "じーた", 0, 245, 170101, 0, 450, 1.965, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 105701, "ジータ", 0, 0, 0, 0, 3, 170101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180101, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 7, "ひより", 1, 199, 180101, 0, 450, 1.62, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 180101, "ヒヨリ（プリンセス）", 0, 0, 0, 0, 3, 180101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180201, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 2, 1, "ゆい", 1, 767, 180201, 0, 450, 1.92, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 180201, "ユイ（プリンセス）", 0, 0, 0, 0, 3, 180201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180301, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 7, "れい", 1, 377, 180301, 0, 450, 1.965, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 180301, "レイ（プリンセス）", 0, 0, 0, 0, 3, 180301, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180401, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 1, "ぺこりーぬ", 1, 155, 180401, 0, 450, 1.965, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 180401, "ペコリーヌ（プリンセス）", 0, 0, 0, 0, 3, 180401, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180501, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 1, "こっころ", 1, 555, 180501, 0, 450, 2.14, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 180501, "コッコロ（プリンセス）", 0, 0, 0, 0, 3, 180501, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180601, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 2, 1, "きゃる", 1, 747, 180601, 0, 450, 1.92, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 180601, "キャル（プリンセス）", 0, 0, 0, 0, 3, 180601, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180701, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 1, "はつねしおり", 1, 732, 180701, 0, 450, 1.75, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 180701, "ハツネ＆シオリ", 0, 0, 0, 0, 3, 180701, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180801, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 1, "みそぎみみきょうか", 1, 465, 180801, 0, 450, 1.5, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 180801, "ミソギ＆ミミ＆キョウカ", 0, 0, 0, 0, 3, 180801, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (180901, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 1, "あきのされん", 1, 421, 180901, 0, 450, 2.09, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 180901, "アキノ＆サレン", 0, 0, 0, 0, 3, 180901, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (181001, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 2, 1, "あんぐれあ", 1, 577, 181001, 0, 450, 2.09, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 181001, "アン＆グレア", 0, 0, 0, 0, 3, 181001, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (181101, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 1, "しずるりの", 1, 551, 181101, 0, 450, 1.92, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 181101, "シズル＆リノ", 0, 0, 0, 0, 3, 181101, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (181201, "2025/12/31 12:00:00", "2026/01/03 11:59:59", 0, 0, 0, 1, 1, "しぇふぃ", 1, 368, 181201, 0, 450, 1.92, "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", 181201, "シェフィ（プリンセス）", 0, 0, 0, 0, 3, 181201, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 1, 0, 1, 1, 0, "かりん", 0, 0, 190801, 0, 0, 0.0, "", 0, "カリン", 0, 0, 0, 0, 1, 190801, 0);
